import React from "react";
import "./Navbar.css";

function Navbar() {
  return (
    <nav>
      <div className="twitch-logo">
        <img src="https://www.tailorbrands.com/wp-content/uploads/2021/04/twitch-logo.png" />
      </div>
    </nav>
  );
}

export default Navbar;
